import { useEffect, useState } from "react";

const Home = () => {

    const [Workouts, setWorkouts] = useState(null);
    useEffect(() => {
        const workoutsFetch = async () => {
            const response = await fetch('/api/workouts')
            const json = response.json()
            if(response.ok){
                setWorkouts(json)
            }
        }
        workoutsFetch()
    }, []);

    return ( 
        <>
        <h1>Hello</h1>
        </>
     );
}
 
export default Home;
